const HOME = 'HOME';

const initialState = {
  socImages: [
    { facebook: '' },
    { instagram: 'https://www.instagram.com/static/images/ico/favicon-200.png/ab6eff595bb1.png' },
    { github: 'github' },
    { gmail: 'gmail' },
    { youtube: 'youtube' },

  ]
}

export default function HomeReducer(state = initialState, action) {

  switch (action.type) {
    default:

      return state;
  }
}
